	List<Class<?>> allClassNames = new ArrayList<>();
	allClassNames.addAll(Arrays.asList(annotation.classes()));
	allClassNames.addAll(Arrays.stream(annotation.classNames())
			.map(this::loadClass).filter(Objects::nonNull).toList());
